import React from 'react';
import { useNavigate, Link } from 'react-router-dom';
import logo from '../assets/logo.png';
import '../../s'// Assurez-vous d'importer les styles

const Interface8 = () => {
    const navigate = useNavigate();

    const handleBackClick = () => {
        navigate('/Residentiel/Interface7'); // Revenir à la page précédente
    };

    return (
        <div className="main-content" >
            <div className="header">
                <NavBar progress={90} debit={25} />
            </div>
            <div className="survey-content" style={{ color: 'white' }}>
                <div className="back-link" onClick={handleBackClick}>&lt;Back</div>
                <div className="survey-form">
                    <h2>Entrez votre numéro de téléphone GSM,<br /> un commercial vous contactera</h2>
                    <div className="form-group">
                        <input
                            type="text"
                            placeholder="Numéro GSM"
                            className="text-input"
                        />
                        <button className="submit-btn">Envoyer</button>
                    </div>
                    <Link
                        to="" // Chemin pour avancer sans entrer de numéro
                        className="link-text"
                    >
                        Non Merci
                    </Link>
                </div>
            </div>
        </div>
    );
}

function NavBar({ progress, debit }) {
    return (
        <div className="navbar">
            <img src={logo} alt="Topnet Logo" className="logo" />
            <ProgressBar progress={progress} />
            <div className="speed-display">{debit} Mbps</div>
        </div>
    );
}

function ProgressBar({ progress }) {
    return (
        <div className="progress-bar-container">
            <div className="progress-bar" style={{ width: `${progress}%` }}></div>
            <span className="progress-text">{`${progress}%`}</span>
        </div>
    );
}

export default Interface8;
